import React from 'react';
import { URL_CLOUD_STORAGE } from '../../../config';
const BotonWhatsapp = () => {
    return (
        <div className="btn-wpp">
            <img src={`${URL_CLOUD_STORAGE}/assets/wpp.png`} className="img-fluid" alt="WhatsApp de Oliver PetShop"/>
        </div>
    );
}

export default BotonWhatsapp;
